import useForm from "react-hook-form";
const Home = () => {
  return (
    <section className="card card--home">
      <h1 className="card__title">NeFT is coming soon</h1>
      <p className="card__subtitle">
        NeFT is a platform to buy, sell and hold cryptocurrency. To get notified
        at launch, please enter your email below.
      </p>
      <form action="#">
        <input
          type="text"
          name="email"
          className="form__input"
          placeholder="Email address"
        />
        <input
          className="btn btn--secondary"
          type="submit"
          value="Get notified"
        />
      </form>
    </section>
  );
};

export default Home;
